import { useState } from 'react'

import React from 'react'

function count() {
    const [counting,setCount] =useState(0)
  return (
    <>
    <div>
        {counting}
    </div>
    <button type="button" onClick={()=>setCount(counting + 1)}>Count Me</button>
    </>
  )
}

export default count
